import React from 'react';
import styled from 'styled-components'

const A = styled.a `
font-family: 'Montserrat', sans-serif;
`
const styles = styled.div `
{
    background: red;
color: red;
}
`

const Nav = styled.nav `


`

function Header() {
  return (
    <header>

        <styles>
            LOGO
        </styles>

        <nav>
            <ul>
                <li>
                    <A href = "#">Hem</A>
                </li>
            </ul>
        </nav>





    </header>
  );
}

export default Header;
